import React from "react";

import withStyle from "../../../../../common/hoc/withStyle";
import styles from "../style/BurgerIngredient.style";

const BurgerIngredient = ({ className, ingredientName }) => {
  return (
    <>
      <h1>BurgerIngredient :</h1>
      <div className={className}>
        <div className={`${ingredientName}`} />
      </div>
    </>
  );
};

export default withStyle(BurgerIngredient, styles);
